## A. The maximum likelihood problem

Based on the assumptions in Section II-A, it follows that $\mathbf{R}_{0}+$ $\eta \mathbf{I}_{M}$ is positive semidefinite and possibly Toeplitz. Because $\mathbf{y}_{\mathcal{S}}(t) \sim \mathcal{C N}\left(\mathbf{0}, \mathbf{R}_{\mathcal{S}}+\eta \mathbf{I}_{N}\right)$, one can formulate the following constrained optimization problem according to the maximum likelihood principle:

$$
\begin{aligned}
& \min _{\mathbf{R} \in \mathbb{R}^{M}} \quad \log \operatorname{det}\left(\boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right)+\operatorname{tr}\left(\left(\boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right)^{-1} \hat{\mathbf{R}}_{\mathcal{S}}\right) \\
& \text { subject to } \quad \mathbf{R} \succeq 0, \quad \mathbf{R} \in \mathbb{T}^{M}
\end{aligned}
$$

By minimizing the Kullback-Leibler divergence of $\mathcal{C N}\left(\mathbf{0}, \hat{\mathbf{R}}_{\mathcal{S}}\right)$ from $\mathcal{C N}\left(\mathbf{0}, \boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right)$, one can also derive the above problem. Due to the nonconvex objective, solving (4) is nontrivial; and thus relaxing or refomulating (4) into a tractable problem is often necessary to arrive at an accepted solution. Section III-B and III-C below describe tractable optimization problems that are widely used in this context.

## C. Direct SDP-based methods

Based on the covariance fitting criterion [32], Yang et al. formulated the SPA [9] involving the optimization problem:

$$
\begin{gathered}
\min _{\mathbf{X} \in \mathbb{R}^{N}, \mathbf{R} \in \mathbb{R}^{M}} \operatorname{tr}(\mathbf{X})+\operatorname{tr}\left(\hat{\mathbf{R}}_{\mathcal{S}}^{-1} \boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right) \\
\text { subject to }\left[\begin{array}{ccc}
\mathbf{X} & \hat{\mathbf{R}}_{\mathcal{S}}^{\frac{1}{2}} \\
\hat{\mathbf{R}}_{\mathcal{S}}^{\frac{1}{2}} & \boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}} & \\
& \mathbf{R}
\end{array}\right] \succeq 0, \quad \mathbf{R} \in \mathbb{T}^{M}
\end{gathered}
$$

The noiseless SCM is then estimated by $\mathbf{R}-\lambda_{\min }(\mathbf{R}) \mathbf{I}_{M}$ where $\mathbf{R}$ is the solution of (6). Another interesting approach based on the Bures-Wasserstein distance [33] was developed by Wang et al. [15]. The optimization problem is given by

$$
\begin{aligned}
& \min _{\mathbf{X} \in \mathbb{C}^{N \times N}, \mathbf{R} \in \mathbb{R}^{M}} \operatorname{tr}\left(\hat{\mathbf{R}}_{\mathcal{S}}+\boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}-\mathbf{X}-\mathbf{X}^{\mathrm{H}}\right) \\
& \text { subject to }\left[\begin{array}{cc}
\boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}} & \mathbf{X} \\
\mathbf{X}^{\mathrm{H}} & \hat{\mathbf{R}}_{\mathcal{S}}
\end{array}\right] \succeq 0, \quad \mathbf{R} \succeq 0, \quad \mathbf{R} \in \mathbb{T}^{M}
\end{aligned}
$$

Both optimization problems in (6) and (7) are SDPs that can be solved by off-the-shelf solvers such as the SDPT3 [34].

## D. Majorization-Minimization

Since the term $\log \operatorname{det}(\cdot)$ in (4) is concave on the positive semidefinite cone and the trace term can be written as an SDP via the Schur complement lemma, majorization-minimization algorithms can be used to tackle (4). Using a supporting hyperplane to majorize the term $\log \operatorname{det}$, one can derive the socalled "StructCovMLE" approach [12]. Let $\mathbf{R}^{(0)}$ be initialized to $\mathbf{I}_{M}$. For $i=0,1,2, \cdots$, StructCovMLE calculates the iterate $\mathbf{R}^{(i+1)}$ by solving the optimal $\mathbf{R}$ in the following SDP:

$$
\begin{aligned}
& \min _{\mathbf{R} \in \mathbb{R}^{M}, \mathbf{X} \in \mathbb{R}^{N}} \operatorname{tr}\left(\left(\boldsymbol{\Gamma} \mathbf{R}^{(i)} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right)^{-1} \boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right)+\operatorname{tr}\left(\mathbf{X} \hat{\mathbf{R}}_{\mathcal{S}}\right) \\
& \text { subject to }\left[\begin{array}{cc}
\mathbf{X} & \mathbf{I}_{N} \\
\mathbf{I}_{N} & \boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}} \\
& \mathbf{R}
\end{array}\right] \succeq 0, \quad \mathbf{R} \in \mathbb{T}^{M}
\end{aligned}
$$

The final solution is then obtained through running a number of iterations until a stopping criterion is satisfied. For example, the relative change between $\mathbf{R}^{(i)}$ and $\mathbf{R}^{(i+1)}$ being sufficiently small. As there is a sequence of SDPs to be solved, the complexity of this approach is greater than the complexity of the above direct SDP-based methods in Section III-C.

## E. Proxy covariance matrix estimation

Instead of estimating the covariance matrix, Sarangi et al. [16] proposed a "proxy covariance matrix" approach (Prox-Cov) that jointly calculates a positive definite weighting matrix $\mathbf{W}$ and a proxy covariance $\mathbf{R}$ such that the weighted covariance matrix from the data best fits the proxy covariance. Based on this rationale, they formulated the following SDP:

$$
\begin{aligned}
& \min _{\mathbf{R} \in \mathbb{R}^{M}, \mathbf{W} \in \mathbb{R}^{T}}\left\|\mathbf{Y} \mathbf{W} \mathbf{Y}^{\mathrm{H}}-\boldsymbol{\Gamma} \mathbf{R} \boldsymbol{\Gamma}^{\boldsymbol{\top}}\right\|_{F}^{2} \\
& \text { subject to } \quad \mathbf{R} \succeq 0, \quad \mathbf{R} \in \mathbb{T}^{M}, \quad \mathbf{W} \succeq \epsilon \mathbf{I}_{T}
\end{aligned}
$$

where $\mathbf{Y}=[\mathbf{y}(1) \quad \mathbf{y}(2) \quad \cdots \quad \mathbf{y}(T)]$ is a matrix whose columns are all of the received snapshots and $\epsilon$ is a hyperparameter which is strictly positive. An interesting property

of (9) is that it can exactly recover the signal subspace, overcoming the shortcoming of (5), under appropriate assumptions [16]. Unlike the aforementioned methods that estimate a covariance matrix from a sample SCM, Prox-Cov considers all snapshots and attempts to estimate the signal and noise subspaces by introducing a weighting matrix $\mathbf{W}$, which allows for arbitrary signal powers while maintaining the same range space from the snapshots.

## A. Subspace representations of different dimensions

Because every $k$-dimensional subspace $\mathcal{U}_{k}$ of $\mathbb{C}^{M}$ is a point in the Grassmann manifold or Grassmannian $\operatorname{Gr}(k, M)$, we construct a DNN model $f_{W}$ such that

$$
f_{W}: \mathbb{C}^{N \times N} \times[M-1] \rightarrow \bigcup_{k=1}^{M-1} \operatorname{Gr}(k, M)
$$

The codomain is a union of $M-1$ Grassmannians. To represent points of this union numerically, we can pick any matrix $\mathbf{U} \in \mathbb{C}^{M \times k}$ whose columns represent a unitary basis of $\mathcal{U}_{k} \in \operatorname{Gr}(k, M)$ for all $k \in[M-1]$. Based on this perspective, the model $f_{W}$ is instructed to generate a matrix $\mathbf{X} \in \mathbb{C}^{M \times M}$ whose Gram matrix is factorized by eigenvalue decomposition:

$$
\mathbf{X} \mathbf{X}^{\mathrm{H}}=\left[\begin{array}{ll}
\tilde{\mathbf{U}} & \tilde{\mathbf{V}}
\end{array}\right]\left[\begin{array}{ll}
\boldsymbol{\Lambda}_{k} & \\
& \boldsymbol{\Lambda}_{M-k}
\end{array}\right]\left[\begin{array}{l}
\tilde{\mathbf{U}}^{\mathrm{H}} \\
\tilde{\mathbf{V}}^{\mathrm{H}}
\end{array}\right]
$$

where $\boldsymbol{\Lambda}_{k}$ and $\boldsymbol{\Lambda}_{M-k}$ are diagonal matrices representing the $k$ largest eigenvalues and $M-k$ smallest eigenvalues, respectively; and the columns of $\tilde{\mathbf{U}}$ and $\tilde{\mathbf{V}}$ are their corresponding orthonormal eigenvectors, respectively. Since the columns of $\tilde{\mathbf{U}} \in \mathbb{C}^{M \times k}$ form a unitary basis, a subspace $\tilde{\mathcal{U}}_{k} \in \operatorname{Gr}(k, M)$

can then be identified by the range space of $\tilde{\mathbf{U}}$ and thus the function $f_{W}$ can generate points in the union of the Grassmannians. As long as $\mathbf{X}$ maintains the same signal subspace, the subspace $\mathcal{U}$ generated by $f_{W}$ is invariant to the change of $\mathbf{X}$. One simple invariance can be easily seen by changing the eigenvalues while maintaining the order of $\boldsymbol{\Lambda}_{k}$ and $\boldsymbol{\Lambda}_{M-k}$. The subspace $\tilde{\mathcal{U}}$ is also invariant to the equivalence class of its unitary bases.

Given a dataset $\mathcal{D}=\left(\hat{\mathbf{R}}_{\mathcal{S}}^{(l)}, \mathbf{R}_{0}^{(l)}\right)_{l=1}^{L}$, we extract the signal subspace $\mathcal{U}^{(l)}$ of $\mathbf{R}_{0}^{(l)}$ for every $l \in[L]$ via eigenvalue decomposition to create target subspace representations. Note that $\mathcal{U}^{(l)}$ can also be identified from $\mathbf{A}\left(\boldsymbol{\theta}^{(l)}\right) \mathbf{A}^{\mathrm{H}}\left(\boldsymbol{\theta}^{(l)}\right)$ if only a dataset of $\left\{\hat{\mathbf{R}}_{\mathcal{S}}^{(l)}, \boldsymbol{\theta}^{(l)}\right\}$ is available.
